  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Monte
  Vista National Wildlife Refuge outlines Refuge accomplishments during the 1994 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the management plan and research and investigations. Refuge administration is outlined;
  information about personnel, volunteer programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  croplands, fire management, pest control, and water rights. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  scientific collections, animal control, marking and banding, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, trapping, wildlife observation, outdoor recreation,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, rehabilitation, and equipment replacement. Cooperative
  programs and items of interest are provided at the end. Refuge brochures are attached\",\n\t\"owner_org\":
